import java.lang.reflect.Method;
import java.util.HashMap;
import java.util.LinkedList;
import java.util.Queue;

import edu.washington.cs.cse490h.lib.Callback;
import edu.washington.cs.cse490h.lib.Utility;

/**
 * Layer above the basic messaging layer that provides reliable, in-order
 * delivery in the absence of faults. This layer does not provide much more than
 * the above.
 * 
 * At a minimum, the student should extend/modify this layer to provide
 * reliable, in-order message delivery, even in the presence of node failures.
 */
public class ReliableInOrderMsgLayer {
	public static int TIMEOUT = 3;

	private HashMap<Integer, InChannel> inConnections;
	private HashMap<Integer, OutChannel> outConnections;
	private RIONode n;
	private int instanceID;

	RIONode getNode() {
		return n;
	}

	/**
	 * Constructor.
	 * 
	 * @param destAddr
	 *            The address of the destination host
	 * @param msg
	 *            The message that was sent
	 * @param timeSent
	 *            The time that the ping was sent
	 */
	public ReliableInOrderMsgLayer(RIONode n) {
		inConnections = new HashMap<Integer, InChannel>();
		outConnections = new HashMap<Integer, OutChannel>();
		this.n = n;
		this.instanceID = -1;
	}

	// XXX: this should really be passed in the constructor, but Node.manager needs to be non-null.
	public void setInstanceID(int instanceID) {
		this.instanceID = instanceID;
	}

	/**
	 * Receive a data packet.
	 * 
	 * @param from
	 *            The address from which the data packet came
	 * @param pkt
	 *            The Packet of data
	 */
	public void RIODataReceive(int from, byte[] msg) {
		RIOPacket riopkt = RIOPacket.unpack(msg);

		// if the client has the wrong destID, let them know that a server failure has occurred
		if(riopkt.getDestInstanceID() != this.instanceID) {
			RIOReConnSend(from, riopkt);
			InChannel in = new InChannel(riopkt.getSourceInstanceID());
			inConnections.put(from, in);
			return;
		}

		InChannel in = inConnections.get(from);
		if(in == null) {
			throw new AssertionError("In connection "+from+" should have existed");
		}

		if(riopkt.getSourceInstanceID() == in.getSourceInstanceID()) {
			RIODataAckSend(from, riopkt);

			LinkedList<RIOPacket> toBeDelivered = in.gotPacket(riopkt);
			for(RIOPacket p: toBeDelivered) {
				// deliver in-order the next sequence of packets
				n.onRIOReceive(from, p.getProtocol(), p.getPayload());
			}
		} // else if the srcID is wrong, ignore it -- we can assume that crashed clients will
		  // always reinitiate a handshake
	}

	// precondition: forPkt.getDestInstanceID() == this.instanceID
	//				 && forPkt.getSourceInstanceID() == inConnections.get(to).getSourceInstanceID()
	//		[basically, forPkt should be valid]
	private void RIODataAckSend(int to, RIOPacket forPkt) {
		RIOPacket ackPkt = new RIOPacket(RIOProtocol.CONTROL,
				forPkt.getSourceInstanceID(), forPkt.getDestInstanceID(),
				forPkt.getSeqNum(), new byte[0]);
		n.send(to, PacketProtocol.DATA_ACK, ackPkt.pack());
	}

	// precondition: forPkt.getDestInstanceID() == this.instanceID
	//				 && forPkt.getSourceInstanceID() == inConnections.get(to).getSourceInstanceID()
	//		[basically, forPkt should be valid]
	private void RIOReConnSend(int to, RIOPacket forPkt) {
		RIOPacket reConnPkt = new RIOPacket(RIOProtocol.CONTROL,
				forPkt.getSourceInstanceID(), forPkt.getDestInstanceID(),
				forPkt.getSeqNum(), Utility.stringToByteArray("" + instanceID)); 
			// we encode our current instanceID into the payload of the error packet
		n.send(to, PacketProtocol.DATA_ACK, reConnPkt.pack());
		System.err.println("===> reconn sent");
	}

	/**
	 * Receive an acknowledgment packet.
	 * 
	 * @param from
	 *            The address from which the data packet came
	 * @param pkt
	 *            The Packet of data
	 */
	public void RIODataAckReceive(int from, byte[] msg) {
		RIOPacket ackPkt = RIOPacket.unpack(msg);
		OutChannel out = outConnections.get(from);
		if(out != null) {
			if(ackPkt.getSourceInstanceID() == instanceID && 
					ackPkt.getDestInstanceID() == out.getDestInstanceID())
				out.gotACK(ackPkt.getSeqNum());
			// else, ignore acks for previous instances
		} // else, ignore the packet since we must have just crashed
	}

	/**
	 * Send a packet using this reliable, in-order messaging layer. Note that
	 * this method does not include a reliable, in-order broadcast mechanism.
	 * 
	 * @param destAddr
	 *            The address of the destination for this packet
	 * @param protocol
	 *            The protocol identifier for the packet
	 * @param payload
	 *            The payload to be sent
	 */
	public void RIOSend(int destAddr, RIOProtocol protocol, byte[] payload) {
		// outchannel doesn't exist (do handshake)
		OutChannel out = outConnections.get(destAddr);
		if(out == null) {
			out = new OutChannel(this, destAddr);
			outConnections.put(destAddr, out);
			// send handshake packet
			out.sendRIOPacket(n, PacketProtocol.SYN, out.createPacket(RIOProtocol.CONTROL, new byte[0]));
		}
		RIOPacket riopkt = out.createPacket(protocol, payload);
		// outchannel exists but handshake hasn't completed yet (no destInstanceID)
		if(out.getDestInstanceID() == -1) {
			out.enqueuePacket(riopkt);
		} else {
			out.sendRIOPacket(n, PacketProtocol.DATA, riopkt);
		}
	}

	/**
	 * Callback for timeouts while waiting for an ACK.
	 * 
	 * This method is here and not in OutChannel because OutChannel is not a
	 * public class.
	 * 
	 * @param destAddr
	 *            The receiving node of the unACKed packet
	 * @param seqNum
	 *            The sequence number of the unACKed packet
	 */
	public void onTimeout(Integer destAddr, Integer seqNum, Integer destInstanceID) {
		OutChannel out = outConnections.get(destAddr);
		if(out != null && out.getDestInstanceID() == destInstanceID) {
			out.onTimeout(n, seqNum);
		}
	}

	@Override
	public String toString() {
		StringBuffer sb = new StringBuffer();
		for(Integer i: inConnections.keySet()) {
			sb.append(inConnections.get(i).toString() + "\n");
		}

		return sb.toString();
	}

	public void RIOSynReceive(Integer from, byte[] msg) {
		RIOPacket riopkt = RIOPacket.unpack(msg);

		InChannel in = inConnections.get(from);
		if(in == null || in.getSourceInstanceID() != riopkt.getSourceInstanceID()) {
			in = new InChannel(riopkt.getSourceInstanceID());
			inConnections.put(from, in);
		}

		RIOPacket synAckPkt = new RIOPacket(RIOProtocol.CONTROL,
				riopkt.getSourceInstanceID(), instanceID, riopkt.getSeqNum(), new byte[0]);
		n.send(from, PacketProtocol.SYN_ACK, synAckPkt.pack());
	}

	public void RIOSynAckReceive(Integer from, byte[] msg) {
		// update our outconnection's dest id
		RIOPacket synAckPkt = RIOPacket.unpack(msg);
		if(synAckPkt.getSourceInstanceID() == instanceID) {
			OutChannel out = outConnections.get(from);
			if(out == null)
				throw new AssertionError("out connection should've existed: " + instanceID);
			out.setDestInstanceID(synAckPkt.getDestInstanceID());
			out.flushPacketBuffer();
		}
	}

	public void RIOReConnReceive(Integer from, byte[] msg) {
		RIOPacket reConnPkt = RIOPacket.unpack(msg);

		OutChannel out = outConnections.get(from);
		if(out != null && reConnPkt.getDestInstanceID() == out.getDestInstanceID() 
				&& reConnPkt.getSourceInstanceID() == instanceID) {
			int newDestInstanceID = Integer.parseInt(Utility.byteArrayToString(reConnPkt.getPayload()));
			OutChannel newChannel = new OutChannel(this, from, newDestInstanceID);
			outConnections.put(from, newChannel);

			// TODO: notify the client somehow that a server failure occurred.
		}
	}

	public int getInstanceID() {
		return instanceID;
	}

}

/**
 * Representation of an incoming channel to this node
 */
class InChannel {
	private int lastSeqNumDelivered;
	private HashMap<Integer, RIOPacket> outOfOrderMsgs;
	private int sourceInstanceID; // The instance ID of the node at the other end of this out channel

	InChannel(int sourceInstanceID){
		this.sourceInstanceID = sourceInstanceID;
		lastSeqNumDelivered = -1;
		outOfOrderMsgs = new HashMap<Integer, RIOPacket>();
	}

	/**
	 * 
	 * @return the sourceInstanceID for this InChannel
	 */
	public int getSourceInstanceID() {
		return sourceInstanceID;
	}

	/**
	 * Method called whenever we receive a data packet.
	 * 
	 * @param pkt
	 *            The packet
	 * @return A list of the packets that we can now deliver due to the receipt
	 *         of this packet
	 */
	public LinkedList<RIOPacket> gotPacket(RIOPacket pkt) {
		LinkedList<RIOPacket> pktsToBeDelivered = new LinkedList<RIOPacket>();
		int seqNum = pkt.getSeqNum();

		if(seqNum == lastSeqNumDelivered + 1) {
			// We were waiting for this packet
			pktsToBeDelivered.add(pkt);
			++lastSeqNumDelivered;
			deliverSequence(pktsToBeDelivered);
		}else if(seqNum > lastSeqNumDelivered + 1){
			// We received a subsequent packet and should store it
			outOfOrderMsgs.put(seqNum, pkt);
		}
		// Duplicate packets are ignored

		return pktsToBeDelivered;
	}

	/**
	 * Helper method to grab all the packets we can now deliver.
	 * 
	 * @param pktsToBeDelivered
	 *            List to append to
	 */
	private void deliverSequence(LinkedList<RIOPacket> pktsToBeDelivered) {
		while(outOfOrderMsgs.containsKey(lastSeqNumDelivered + 1)) {
			++lastSeqNumDelivered;
			pktsToBeDelivered.add(outOfOrderMsgs.remove(lastSeqNumDelivered));
		}
	}

	@Override
	public String toString() {
		return "last delivered: " + lastSeqNumDelivered + ", outstanding: " + outOfOrderMsgs.size();
	}
}

/**
 * Representation of an outgoing channel to this node
 */
class OutChannel {
	private HashMap<Integer, RIOPacket> unACKedPackets;
	private int lastSeqNumSent;
	private ReliableInOrderMsgLayer parent;
	private int destAddr;
	private int destInstanceID;
	private Queue<RIOPacket> toBeSent;

	public int getDestInstanceID() {
		return destInstanceID;
	}

	public void setDestInstanceID(int destInstanceID) {
		this.destInstanceID = destInstanceID;
	}

	public void enqueuePacket(RIOPacket riopkt) {
		toBeSent.add(riopkt);
	}

	// precondition: destInstanceID != -1
	public void flushPacketBuffer() {
		for(RIOPacket riopkt : toBeSent) {
			riopkt.
			sendRIOPacket(parent.getNode(), PacketProtocol.DATA, riopkt);
		}
		toBeSent.clear();
	}

	OutChannel(ReliableInOrderMsgLayer parent, int destAddr) {
		this(parent, destAddr, -1);
	}

	OutChannel(ReliableInOrderMsgLayer parent, int destAddr, int destInstanceID) {
		this.lastSeqNumSent = -1;
		this.destInstanceID = destInstanceID; // We don't know the instance ID of the destination until
							 // we perform our handshake.
		this.unACKedPackets = new HashMap<Integer, RIOPacket>();
		this.toBeSent = new LinkedList<RIOPacket>();
		this.parent = parent;
		this.destAddr = destAddr;
	}

	public RIOPacket createPacket(RIOProtocol rioProtocol, byte[] payload) {
		RIOPacket newPkt = new RIOPacket(rioProtocol, parent.getInstanceID(),
				destInstanceID, ++lastSeqNumSent, payload);
		return newPkt;
	}

	/**
	 * Send a new RIOPacket out on this channel.
	 * 
	 * @param n
	 *            The sender and parent of this channel
	 * @param protocol
	 *            The protocol identifier of this packet
	 * @param payload
	 *            The payload to be sent
	 */
	protected void sendRIOPacket(RIONode n, PacketProtocol pktProtocol, RIOPacket riopkt) {
		try{
			Method onTimeoutMethod = Callback.getMethod("onTimeout", parent, new String[]{ "java.lang.Integer", "java.lang.Integer", "java.lang.Integer" });
			unACKedPackets.put(lastSeqNumSent, riopkt);

			n.send(destAddr, pktProtocol, riopkt.pack());
			n.addTimeout(new Callback(onTimeoutMethod, parent, new Object[]{ destAddr, lastSeqNumSent, destInstanceID }), ReliableInOrderMsgLayer.TIMEOUT);
		}catch(Exception e) {
			e.printStackTrace();
		}
	}

	/**
	 * Called when a timeout for this channel triggers
	 * 
	 * @param n
	 *            The sender and parent of this channel
	 * @param seqNum
	 *            The sequence number of the unACKed packet
	 */
	public void onTimeout(RIONode n, Integer seqNum) {
		if(unACKedPackets.containsKey(seqNum)) {
			resendRIOPacket(n, seqNum);
		}
	}

	/**
	 * Called when we get an ACK back. Removes the outstanding packet if it is
	 * still in unACKedPackets.
	 * 
	 * @param seqNum
	 *            The sequence number that was just ACKed
	 */
	protected void gotACK(int seqNum) {
		unACKedPackets.remove(seqNum);
	}

	/**
	 * Resend an unACKed packet.
	 * 
	 * @param n
	 *            The sender and parent of this channel
	 * @param seqNum
	 *            The sequence number of the unACKed packet
	 */
	private void resendRIOPacket(RIONode n, int seqNum) {
		try{
			Method onTimeoutMethod = Callback.getMethod("onTimeout", parent, new String[]{ "java.lang.Integer", "java.lang.Integer", "java.lang.Integer" });
			RIOPacket riopkt = unACKedPackets.get(seqNum);

			n.send(destAddr, PacketProtocol.DATA, riopkt.pack());
			n.addTimeout(new Callback(onTimeoutMethod, parent, new Object[]{ destAddr, seqNum, destInstanceID }), ReliableInOrderMsgLayer.TIMEOUT);
		}catch(Exception e) {
			e.printStackTrace();
		}
	}
}

